//mall.runorout.cn", URL_MONITOR_INVITE_RULR="https://mp.weixin.qq.com/s/2yalQX8hJbwA7Hx9IVOmMA", WX_SERVER_ID_VALID_DAY=3, TYPE_SHARE_WORD_INVITE_MONITOR=2, SHARE_DESC="万人坚持跑步打卡100天，看到坚持的力量", datePopup={"2019-12-13":"/meta/activity_3/popup/countdown/3.png","2019-12-14":"/meta/activity_3/popup/countdown/2.png","2019-12-15":"/meta/activity_3/popup/countdown/1.png","2019-12-16":"/meta/activity_3/popup/countdown/0.png"}, COMMON_CONTRACT="甲乙双方自愿、友好协商，就第十一届百日跑赛事项目合作，自愿结成合作伙伴，达成以下协议：\n\n一、名词解释\n1、百日跑： 针对广大跑友进行的一项全民跑步活动，百日跑要求在120天内奔跑100天，期间不追求配速，不追求跑量，追求的是在100天内让身体处于运动的一种状态，从而养成习惯，提升体能。\n2、甲方对所有推荐人的福利要求以第十一届百日跑活动推文为准，结算价格为甲方与乙方进行结算的价格。\n3、乙方商业机密：包括但不限于\n（1）乙方在业务及商业活动中所涉及的各类资料﹑非甲方及其自主设计的活动大纲、测试题、项目总结及乙方未对外披露的文件资料﹑软件等；\n（2）乙方的发展规划﹑经营战略﹑决策﹑销售信息﹑客户信息资料﹑乙方为客户设计的各类方案﹑流程；\n4、甲方知识产权：指甲方提供的所有材料，包括但不限于活动章程、线路、项目总结及文件资料﹑软件等，甲方对乙方提供的课件、活动、咨询服务等拥有完全的知识产权。\n5、甲方商业秘密：包括但不限于\n（1）甲方知识产权；\n（2）甲方的宣传、组织、执行、后勤服务等费用；\n（3）甲方在业务及商业活动中所涉及的各类资料，甲方赛事章程、活动总结及甲方未对外披露的活动文件资料﹑软件等。\n\n二、合作目标\n通过百日跑，让更多的人加入到这场万人跑步奇迹，推动中华民族身体素质的提升，并提升双方的品牌知名度，一起打造赛事第一品牌，让百日跑成为每个人入门级、进阶级、高阶级的一个途径，让每一个跑步爱好者都能完成挑战，养成跑步习惯。\n\n三、合作限制\n    1、甲方是乙方百日跑赛事的唯一合作伙伴；\n2、乙方为甲方推荐具备以下条件的新队长（未担任过百日跑活动队长）：\n（1）拥有一定的招募能力、宣传能力、管理能力；\n（2）参加过百日跑活动、热爱户外运动、且认同我们的价值观；\n（3）拥有线上、线下社群与人群组织等资源；\n3、出现以下情形时，甲方有权重新选择合作伙伴，本协议终止：\n乙方擅自更改甲方规则条约，造成甲方名誉受损行为。\n乙方有违背契约精神、商业道德的行为，甲方正式沟通无效者则取消合作关系；\n乙方有损害其他推荐人权益及损害甲方权益的的行为。\n合约有效期2019年9月2日至2019年12月30日，未签约且未履行本合同权利义务的，视为主动放弃推荐奖励；\n乙方推荐队长签订推荐人合同后，再加入友商赛事中，视为主动放弃推荐人身份；\n取消被推荐人队长资格后，一切推荐人权益解除。\n\n四、推荐人权益：\n（1）推荐制度：\n  队员介绍新的队长成为队长，新队长招募满100人，老队长奖励1000元。\n注：赛事招募期间的个别营销推广成本由乙方承担；奖金需扣税6%\n\n人数确认：开赛后两天内，双方通过本合同约定确认邀请队长的最终战队人数，具体情况按照第十一届百日跑规则方案执行。\n\n（4）退赛原则：\n1、百日跑一旦报名成功，因个人原因【身体原因参考（3）】无法继续参赛概不退款。\n2、如身体原因无法短期内跑步，建议休息一段时间，百日跑120天内有20天的时间是允许休息的。\n3、如身体出现长期无法继续跑步的情况，允许提退出申请，在公号 -更多 - 我的 - 问题咨询页面出示病症等材料证明，工作人员核实后可退押金退出百日跑活动，退出后，团队保留原始数据，此后此人数据为0。\n\n五、甲乙双方的权利和义务\n1、甲方负责赛事的品牌推广、技术支持等工作；\n2、乙方所推荐的队长需负责的宣传、推广、招募、训练、参赛等全面工作；\n3、乙方所推荐队长需要按照赛事筹备时间节点的要求完成赛事相关的准备和参赛工作；\n4、乙方保证其已向推荐队长详细介绍了赛事的内容包括但不限于参赛要求、赛事内容、参赛价格、参赛时间、参赛风险等；\n5、乙方承诺并保证推荐队长在进行第十一届百日跑赛事推广、宣传、营销过程中，严格按照甲方的要求及赛事内容进行推广宣传，不得作出超出赛事范围的承诺，否则因此产生的一切责任，由乙方和推荐队长承担；\n6、甲乙双方为互相独立的民事主体，不存在任何关联关系，除为完成本协议项下的合作事宜，乙方不得擅自使用甲方的商标、专利、名称及甲方提供的资料对外宣传，亦不得利用甲方的名义对外承担担保、抵押或其他有损甲方利益、商誉等行为。\n\n六、违约责任\n本协议甲方的损失指甲方的直接损失、间接损失、为维权而产生的费用（包括但不限于律师费、诉讼费、公证费、鉴定费、取证费、差旅费、误工费等）。\n\n七、合作期限\n本合作协议合作期限，自2019年9月2日起至2019年12月30日止。\n\n八、协议附件\n本协议项下的合作内容以及相关条款如有不完善的部分，双方将协商另立书面说明，并作为本协议的附件，是本协议不可分割的一部分。\n如果没有特别说明，本协议各项条款同样适用于协议附件。如果附件中的条款与本协议相抵触，以附件中的说明为准。\n双方针对某一次具体合作内容的具体事宜，包括除本协议所列的服务内容外的服务范围、收费模式及其他需要共同商讨之议题等，将经由双方友好协商达成一致后执行。\n\n九、不可抗力\n如果出现严重阻挠任何一方履行协议义务的不可抗力事件，或者此等不可抗力事件使得协议目的无法实现，则该方应当无任何迟延地通知另一方关于其履行合同义务或者履行部分合同义务受影响的程度，并向对方出具相关证明。\n\n十、保密条款\n本保密条款不因双方合作的终止而无效。在双方合作终止后一年内，本保密条款对双方仍具有约束力。\n在任何时候，不论是在本合作协议有效期还是合作协议终止以后，任何一方对在合作过程中了解的有关另一方的商业机密信息，均应承担保密义务。除非另一方书面同意，任何一方不得在任何时间向任何人透漏任何商业机密信息。 未经对方书面同意，任何一方不得将本合作具体合作内容，以任何方式透漏给第三方。\n\n十一、争议解决\n因执行本协议所发生的或与本协议有关的一切争议，双方应通过友好协商解决，如协商未能解决，则提交甲方所在地人民法院管辖。\n\n十二、生效期限\n1.本合作协议及附件自双方签字并盖章之日起生效。\n2.此协议壹式贰份，双方各执壹份，具有同等法律效力。", MONITOR_CONTRACT="甲乙双方自愿、友好协商，就第十一届百日跑赛事项目合作，自愿结成合作伙伴，达成以下协议：\n\n一、名词解释\n1.\t百日跑：针对广大跑友进行的一项全民跑步活动，百日跑要求在120天内奔跑100天，期间不追求配速，不追求跑量，追求的是在100天内让身体处于运动的一种状态，从而养成习惯，提升体能。\n2.\t甲方所有对队长的福利要求以第十一届百日跑队长招募推文为准，结算价格为甲方与乙方进行结算的价格。\n3.\t乙方商业机密：包括但不限于\n(1)\t乙方在业务及商业活动中所涉及的各类资料﹑非甲方及其自主设计的活动大纲、测试题、项目总结及乙方未对外披露的文件资料﹑软件等；\n(2)\t乙方的发展规划﹑经营战略﹑决策﹑销售信息﹑客户信息资料﹑乙方为客户设计的各类方案﹑流程；\n4.\t甲方知识产权：指甲方提供的所有材料，包括但不限于活动章程、线路、项目总结及文件资料﹑软件等，甲方对乙方提供的课件、活动、咨询服务等拥有完全的知识产权。\n5.\t甲方商业秘密：包括但不限于\n(1)\t甲方知识产权；\n(2)\t甲方的宣传、组织、执行、后勤服务等费用；\n(3)\t甲方在业务及商业活动中所涉及的各类资料，甲方赛事章程、活动总结及甲方未对外披露的活动文件资料﹑软件等。\n\n二、合作目标\n通过百日跑，让更多的人加入到这场万人跑步奇迹，推动中华民族身体素质的提升，并提升双方的品牌知名度，一起打造赛事第一品牌，让百日跑成为每个人入门级、进阶级、高阶级的一个途径，让每一个跑步爱好者都能完成挑战，养成跑步习惯。\n\n三、合作限制\n1.\t甲方是乙方百日跑赛事的唯一合作伙伴；\n2.\t乙方具备以下条件：\n(1)\t拥有一定的招募能力、宣传能力、管理能力；\n(2)\t参加过百日跑活动、热爱户外运动、且认同我们的价值观；\n(3)\t拥有线上、线下社群与人群组织等资源；\n3.\t出现以下情形时，甲方有权重新选择合作伙伴，本协议终止：\n（1）\t乙方擅自更改甲方规则条约，造成甲方名誉受损行为。\n（2）\t乙方有违背契约精神、商业道德的行为，甲方正式沟通无效者则取消合作关系；\n（3）\t乙方有损害其他队长权益及损害甲方权益的的行为。\n（4）\t合约有效期2019年9月2日至2019年12月30日，未签约且未履行本合同权利义务的，视为主动放弃队长身份；\n（5）\t乙方签订队长合同后，再加入友商赛事中，视为主动放弃队长身份；\n（6）\t取消队长资格后，一切队长权益解除。\n\n四、队长权益：\n1.\t福利机制\n权益回报：（此政策仅适用于“百日跑公众号第十一届百日跑”）\n(1)\t按一场百日跑赛事计算。\n(2)\t返利佣金总额=首支战队满百后战队总人数*100元（报名结束后签约之日起7天内，先返现佣金总额的50% ；完赛后战队完赛率≥80%，再返现剩余50%的奖励。奖金包含税点为6%。）\n\n阶梯回报：（此政策仅适用于“百日跑公众号第十一届百日跑”）\n(3)\t按一场百日跑赛事计算。\n最终招募满10-59人，队长获得199元现金红包\n最终招募满60-99人，队长获得299元现金红包\n注：仅发放到最终人数所在的档位最高档位；奖金包含税点为6%\n\n2.\t推荐制度：\n  队长介绍新的队长成为队长，新队长招募满100人，老队长奖励1000元。\n注：赛事招募期间的个别营销推广成本由乙方承担；奖金包含税点为6%\n\n3.\t费用结算：\n(1)\t返利费结算时间：\n乙方参赛人员须使用甲方官方报名通道支付全额报名费，甲方于报名通道关闭后7个工作日支付乙方满百人后的50%，赛事结束后满百战队完赛率达到80%及以上，再完成尾款对账。\n(2)\t人数确认：开赛后两天内，双方通过本合同约定确认最终战队人数，若乙方在人数确认后提出报名需求或队员退赛需求，应与甲方沟通，甲方有权拒绝，或按照第十一届百日跑规则方案执行。\n\n4.\t退赛原则：\n(1)\t百日跑一旦报名成功，因个人原因【身体原因参考（3）】无法继续参赛概不退款。\n(2)\t如身体原因无法短期内跑步，建议休息一段时间，百日跑120天内有20天的时间是允许休息的。\n(3)\t如身体出现长期无法继续跑步的情况，允许提退出申请，在公号 -更多 - 我的 - 问题咨询页面出示病症等材料证明，工作人员核实后可退押金退出百日跑活动，退出后，团队保留原始数据，此后此人数据为0。\n五、甲乙双方的权利和义务\n1.\t甲方负责赛事的品牌推广、技术支持等工作；\n2.\t乙方需负责的宣传、推广、招募、训练、参赛等全面工作；\n3.\t乙方需要按照赛事筹备时间节点的要求完成赛事相关的准备和参赛工作；\n4.\t乙方保证其已向参赛人员详细介绍了赛事的内容包括但不限于参赛要求、赛事内容、参赛价格、参赛时间、参赛风险等；\n5.\t乙方承诺并保证其在进行第十一届百日跑赛事推广、宣传、营销过程中，严格按照甲方的要求及赛事内容进行推广宣传，不得作出超出赛事范围的承诺，否则因此产生的一切责任，由乙方承担；\n6.\t乙方应保证其活动参与人员的身体情况必须满足本活动的需要，并充分了解认可本活动的内容、要求及相关风险，否则甲方有权拒绝接收，因此造成的一切后果由乙方承担。\n7.\t乙方尽力确保其队员全程完成比赛，若中途退赛，甲方不予退费。\n8.\t甲乙双方为互相独立的民事主体，不存在任何关联关系，除为完成本协议项下的合作事宜，乙方不得擅自使用甲方的商标、专利、名称及甲方提供的资料对外宣传，亦不得利用甲方的名义对外承担担保、抵押或其他有损甲方利益、商誉等行为。\n\n六、违约责任\n本协议甲方的损失指甲方的直接损失、间接损失、为维权而产生的费用（包括但不限于律师费、诉讼费、公证费、鉴定费、取证费、差旅费、误工费等）。\n\n七、合作期限\n本合作协议合作期限，自2019年9月2日起至2019年12月30日止。\n\n八、协议附件\n本协议项下的合作内容以及相关条款如有不完善的部分，双方将协商另立书面说明，并作为本协议的附件，是本协议不可分割的一部分。\n如果没有特别说明，本协议各项条款同样适用于协议附件。如果附件中的条款与本协议相抵触，以附件中的说明为准。\n双方针对某一次具体合作内容的具体事宜，包括除本协议所列的服务内容外的服务范围、收费模式及其他需要共同商讨之议题等，将经由双方友好协商达成一致后执行。\n\n九、不可抗力\n如果出现严重阻挠任何一方履行协议义务的不可抗力事件，或者此等不可抗力事件使得协议目的无法实现，则该方应当无任何迟延地通知另一方关于其履行合同义务或者履行部分合同义务受影响的程度，并向对方出具相关证明。\n\n十、保密条款\n本保密条款不因双方合作的终止而无效。在双方合作终止后一年内，本保密条款对双方仍具有约束力。\n在任何时候，不论是在本合作协议有效期还是合作协议终止以后，任何一方对在合作过程中了解的有关另一方的商业机密信息，均应承担保密义务。除非另一方书面同意，任何一方不得在任何时间向任何人透漏任何商业机密信息。 未经对方书面同意，任何一方不得将本合作具体合作内容，以任何方式透漏给第三方。\n\n\n十一、争议解决\n因执行本协议所发生的或与本协议有关的一切争议，双方应通过友好协商解决，如协商未能解决，则提交甲方所在地人民法院管辖。\n\n十二、生效期限\n1.本合作协议及附件自双方签字并盖章之日起生效。\n2.此协议壹式贰份，双方各执壹份，具有同等法律效力。", TEAM_LABELS=[{value:"企业跑团",text:"企业跑团",color:"#4A90E2",bg:"#DDEDFF"},{value:"学校跑团",text:"学校跑团",color:"#FF9A0D",bg:"#FFF2E1"},{value:"社会跑团",text:"社会跑团",color:"#FF6924",bg:"#FFDEDE"}];},"51f7":function(t,e,n){"use strict";var _node_modules_mini_css_extract_plugin_dist_loader_js_ref_10_oneOf_1_0_node_modules_css_loader_index_js_ref_10_oneOf_1_1_node_modules_vue_loader_lib_loaders_stylePostLoader_js_node_modules_postcss_loader_src_index_js_ref_10_oneOf_1_2_node_modules_less_loader_dist_cjs_js_ref_10_oneOf_1_3_node_modules_cache_loader_dist_cjs_js_ref_0_0_node_modules_vue_loader_lib_index_js_vue_loader_options_qrcodePopup_vue_vue_type_style_index_0_lang_less___WEBPACK_IMPORTED_MODULE_0__=__webpack_require__("ddff"), _node_modules_mini_css_extract_plugin_dist_loader_js_ref_10_oneOf_1_0_node_modules_css_loader_index_js_ref_10_oneOf_1_1_node_modules_vue_loader_lib_loaders_stylePostLoader_js_node_modules_postcss_loader_src_index_js_ref_10_oneOf_1_2_node_modules_less_loader_dist_cjs_js_ref_10_oneOf_1_3_node_modules_cache_loader_dist_cjs_js_ref_0_0_node_modules_vue_loader_lib_index_js_vue_loader_options_qrcodePopup_vue_vue_type_style_index_0_lang_less___WEBPACK_IMPORTED_MODULE_0___default=__webpack_require__.n(_node_modules_mini_css_extract_plugin_dist_loader_js_ref_10_oneOf_1_0_node_modules_css_loader_index_js_ref_10_oneOf_1_1_node_modules_vue_loader_lib_loaders_stylePostLoader_js_node_modules_postcss_loader_src_index_js_ref_10_oneOf_1_2_node_modules_less_loader_dist_cjs_js_ref_10_oneOf_1_3_node_modules_cache_loader_dist_cjs_js_ref_0_0_node_modules_vue_loader_lib_index_js_vue_loader_options_qrcodePopup_vue_vue_type_style_index_0_lang_less___WEBPACK_IMPORTED_MODULE_0__);a.null;},"5c48":function(t,e,n){},"5dd7":function(t,e,n){"use strict";var _node_modules_mini_css_extract_plugin_dist_loader_js_ref_10_oneOf_1_0_node_modules_css_loader_index_js_ref_10_oneOf_1